import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {

    const links = {
        textDecoration: 'none',
        color: '#fff',
    }

    const subNavLink = {

    }

  return (
    <>

        <div className="subNav">
            <Link style={subNavLink} to="/contact">Contact Us</Link>
        </div>

        <nav style={links}>
        <Link to='/'>
            <img src="/images/cbsiLogo.png" alt="CBSI" className="navLogo"/>
        </Link>
            <ul className="nav-links">
                <Link style={links} to='/'>
                    <li className="link">HOME</li>
                </Link>
                <Link style={links} to='/about'>
                    <li className="link">ABOUT</li>
                </Link>
                <Link style={links} to='/services'>
                    <li className="link">SERVICES</li>
                </Link>
                <Link style={links} to='/projects'>
                    <li className="link">OUR PROJECTS</li>
                </Link>
                <Link style={links} to='/contact'>
                    <li className="link">CONTACT</li>
                </Link>
            </ul>
        </nav>

    </>
  );
}

export default Nav;
